import React, { useState } from 'react'

// components
import FunctionUI from '../components/FunctionUI';
import Nav from './../'

const Portfolio = ({ }) => {

    const [display, setDisplay] = useState(true);
    const data = "english"
    return (
        <div>
            <FunctionUI
                leng={data}
                setDisplay={setDisplay}
                display={display}
            />
        </div>
    )
}

export default Portfolio;
